# %%
import json
import pyperclip
from common import Common


class Sym_conv:

    data = []
    data_before = []
    data_out = []

    len_before = 0
    case = ''

    def __init__(self, data: list = [], case: str = 'lower'):
        data = set(data)
        self.len_before = len(data)
        self.data = data
        self.data_before = data
        self.case = case

    def _replace(self, pattern: str, with_what: str):
        self.data = [v.replace(pattern, with_what) for v in self.data]
        assert self.len_before == len(set(self.data))

    def _replace_dict(self, dictos: dict = {}):
        for k, v in dictos.items():
            self._replace(k, v)

    def finalize(self):
        assert len(set(self.data)) == len(set(self.data_before))

        if self.case == 'lower':
            self.data = [x.lower() for x in self.data]
        elif self.case == 'upper':
            self.data = [x.upper() for x in self.data]

        self.out = Sym_conv.two_lists_to_dict(self.data_before, self.data)

        assert self.len_before == len(self.out)

        pyperclip.copy(json.dumps(self.out))
        for k, v in self.out.items():
            print(f'{k}: {v}, ')

    @staticmethod
    def two_lists_to_dict(l1: list = [], l2: list = []):
        return {v1: v2 for v1, v2 in zip(l1, l2)}

